import { Link } from "react-router-dom";

function Nav(){
    return (
        <>
          <nav className="nav">
            <Link to="/">Home</Link>
            <Link to="/BrowseRecipes">Browse Recipes</Link>
            <Link to="/FridgeSense">FridgeSense</Link>
            <Link to="/SubmitRecipe">Submit Recipe</Link>
            <Link to="/Events">Events</Link>
            <Link to="/Login">Login</Link>
          </nav>
        </>
    );
}

export default Nav;
